import React from 'react';
import './App.css';
import ReviewItems from './Reviews';
import Produks from './Produks';

function App() {
  return (
    <div className="Parentbox">
      <FotoProduk />
      <ProdukInfo />
      <ReviewItems />
    </div>
  );
}

function FotoProduk() {
  return (
    <div className="Foto">
      <img src="baju.jpg" alt="baju" />
    </div>
  );
}


export default App;
